import React, {Component} from 'react';
import './App.css';

class About extends Component {

  styles = {
    image: {
      width: 200,
      height: 200
    }
  };

render() {
	return(
    <div>
      <center><h1>About Us</h1></center>
      <center><p>The goal of this website is to provide a place for users to build a more healthy diet by drawing correlations between
      certain foods and diseases and also providing some restaurants to find these foods. By allowing users to see and understand the 
      risks behind consuming these certain foods we can notify more people about food related diseases.</p></center>
      <hr></hr>
      <img class = "img-thumbnail" src = {require("./photos/Alex.jpeg")} style = {this.styles.image}/>
      <p>Alex Ng</p>
      <br></br>
      <img class = "img-thumbnail" src = {require("./photos/Huylar.png")} style = {this.styles.image}/>
      <p>Huylar Lee</p>
      <br></br>
      <img class = "img-thumbnail" src = {require("./photos/Kelvin.jpeg")} style = {this.styles.image}/>
      <p>Kelvin Yu</p>
      <br></br>
      <img class = "img-thumbnail" src = {require("./photos/Murray.png")} style = {this.styles.image}/>
      <p></p>
      <br>Murray Lee</br>
      <img class = "img-thumbnail" src = {require("./photos/Steven.jpeg")} style = {this.styles.image}/>
      <p></p>
      <br>Steven Sun</br>
      <img class = "img-thumbnail" src = {require("./photos/William.jpeg")} style = {this.styles.image}/>
      <p></p>
      <br>William Suh</br>
      <a href = "https://gitlab.com/williamsuh123/foodforthoughts">Link to our GitLab</a>
    </div>

	)
}

}



export default About;
